import React from 'react';
import './Home.css';
import CurvedText from '../components/CurvedText';
import ReactCurvedText from "react-curved-text";

const Home = () => {
  return (
    <div className='home-container'>Home
    <div className='title'>
      <h1>The Voice Notes</h1>
    </div>
    <ReactCurvedText
      width={270}
      height={300}
      cx={190}
      cy={120}
      rx={100}
      ry={100}
      startOffset={100}
      reversed ={true}
      text="curved text"/>
    </div>

  )
}

export default Home;
